$(document).ready(function(){$("#search-box").keyup(function(t){13==t.keyCode&&$("#search").trigger("click")}),$("#search").on("click",function(){var t=encodeURI($("#search-box").blur().val());$.ajax({url:"https://en.wikipedia.org/w/api.php",dataType:"jsonp",data:{action:"query",format:"json",generator:"search",gsrsearch:t,gsrlimit:"10"},success:function(t){$("#results ul").empty();var e=t.query.pages;for(var n in e)$("#results ul").append('<li class="col-xs-12 col-md-4"><a href="https://en.wikipedia.org/wiki/'+e[n].title+'" target="_new" class="content-block"><h4>'+e[n].title+"</h4></a></li>")}})})});
